import * as React from 'react';
import Button from '@mui/material/Button';
import HomeIcon from '@mui/icons-material/Home';
import SendIcon from '@mui/icons-material/Send';
import Stack from '@mui/material/Stack';

export default function sidebar() {
    return (
      <div class style={{ position: 'fixed', left: 0, top: 0, height: '100%', backgroundColor: 'black' , width: 300, display: 'flex', justifyContent: 'flex-start', alignItems: 'flex-start'}}>
        <Stack spacing={1} direction="column">
          <Button href="/user" variant="text" startIcon={<HomeIcon />} style={{ color: 'white'}}>
            Accueil
          </Button>
          <Button variant="text" startIcon={<SendIcon />} style={{ color: 'white'}}>
            Send
          </Button>
          <Button >Page 3</Button>
        </Stack>
      </div>
    );
  }
